export default {
  name: 'removeModal',
  props: {
    id: {
      type: String,
      default: ''
    },
    modal: {
      type: Boolean,
      default: false
    },
    title: {
      type: String,
      default: '用户删除'
    },
    okText: {
      type: String,
      default: '确认'
    }
  },
  created: function created() {},
  mounted: function mounted() {},
  data: function data() {
    return {
      removeModal: false,
      removeLoading: false,
      removeForm: {
        id: ''
      }
    };
  },
  watch: {
    modal: function modal(val) {
      if (val && this.id !== '') {
        this.removeForm.id = this.id;
        this.removeModal = val;
      }
    },
    removeModal: function removeModal(val) {
      if (!val) {
        this.$emit('on-modal-change', '', val);
      }
    }
  },
  methods: {
    handleOk: function handleOk() {
      var _this = this;
      this.removeLoading = true;
      this.$store.dispatch('removeUser', {
        data: {
          id: this.removeForm.id
        }
      }).then(function () {
        _this.handleCancel();
        _this.$Message.success(_this.title + '成功！');
        _this.$emit('on-refresh-page');
      }, function (res) {
        _this.handleCancel();
        _this.$Message.error(res.data.message);
      });
    },
    handleCancel: function handleCancel() {
      this.removeForm.id = '';
      this.removeModal = false;
      this.removeLoading = false;
    }
  }
};
